import React from 'react';
import './PageStyles.css';
import {motion} from 'framer-motion';

const Blog = () => (
    <div className="page">
        <h1>Blog</h1>
        <p>Deep thinking with the deep</p>
        <div className="blog-preview">
            <h3>Kennst du Oleg?</h3>
            <p>OlegmirdochdieEier kekw</p>
        </div>
    </div>
);

export default Blog;
